  false,\n\t\"url\": null,\n\t\"notes\": \"All fishes currently known from the Samoan
  Islands are listed by their scientific and Samoan names. Species entries are annotated
  to include the initial Samoan distributional record, synonyms used in earlier publications
  dealing with Samoan fishes, and comments relating to taxonomy, ecology, and distribution.
  New species records resulting from recent collections by the author and others are
  included. Brief diagnoses are provided for undescribed and unidentified species.
  The list totals 991 species representing 113 families; 284 of the species are previously
  unrecorded from Samoa and 38 of the entries are unconfirmed records derived mostly
  from 19th century publications.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
